import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import HomePage from "./HomePage";
function MyInfo() {
  return (
    <div>
      <h1>Hi Jishnu Suresh</h1>
      <p>
        this website has nothing abou me in it. Listing places I would like to
        visit on my vaccation
      </p>
      <ol>
        <li>europe</li>
        <li>chine</li>
        <li>america</li>
      </ol>
      ,
      <ol>
        <li>kerala</li>
        <li>utharPradesh</li>
        <li>AndraPradesh</li>
      </ol>
    </div>
  );
}
ReactDOM.render(<MuInfo />, document.getElementById("root"));
